SET NOCOUNT ON;
INSERT INTO [Identity].[RoleClaims] ([ClaimType], [ClaimValue], [CreatedBy], [CreatedOn], [Description], [Group], [LastModifiedBy], [LastModifiedOn], [RoleId], [TenantId])
